import React from 'react';
import Contact from './contact.png'


function contact() {
    return (
        <div className='contactContainer'>
            <div className='contactImageContainer'>
            <img src={Contact} className='contactImage'/>
            </div>
           
            
          
           
        
            
        </div>
    );
}

export default contact;
